import React, { Component } from 'react'

class Contat extends Component {
  render() {
    return (
      <div>
        <div>
          <h3>Contato</h3>
        </div>

        <div>
            <a href='https://www.linkedin.com/in/caroline-nunes-devfullstack/' target="_blank" rel="noreferrer"></a>
        </div>
      </div>
    )
  }
}

export default Contat
